(111,	'1071',	NULL,	NULL,	'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.\n\nThe standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.',	NULL,	NULL,	'text',	'2022-03-12 16:38:47',	'Friends Only',	NULL),
(112,	'1071',	NULL,	NULL,	'Boxing is a combat sport that has been practiced since before the time of ancient Greece and the original Olympics. It has been used to train people for performance in the art of striking, as well as general physical conditioning.\n\nRecently, it has become more popular as a form of exercise. When people box for fitness, they often use a punching bag, avoiding the physical contact that can lead to concussions and other injuries. However, boxing for fitness still provides boxing’s inherent benefits.',	NULL,	NULL,	'text',	'2022-03-12 16:40:20',	'Friends Only',	NULL),
