(149,	'1071',	NULL,	NULL,	'When you think of boxing, you may picture greats like Rocky Marciano duking it out with Jersey Joe Walcott. But boxing isn\'t just a sport anymore. It\'s also a popular way to stay fit among older adults, through a version known as fitness boxing. There\'s no getting into a ring or taking any punches, so there\'s no risk of head trauma. Instead, fitness boxing has adapted the movements of the sport into exercise routines. \"This kind of boxing has many health benefits, because it constantly requires you to think, change your position, and change your posture,\" says physical therapist Linda Arslanian, director of rehabilitation services at Harvard-affiliated Brigham and Women\'s hospital.',	'http://3.7.53.246/pulsehealth//core/storage/trynos/pulsehealth/images/ZCzwUa1qDe6WupB8qzXEhxffAohMGMKa2Njq6wOJ.jpg',	NULL,	'image',	'2022-03-15 12:11:32',	'Friends Only',	NULL),
